import logo from "./../../images/logo.PNG";
import {Nav} from "../../components/Nav";
import {Header} from "../../components/Header";
import {Footer} from "../../components/Footer";
import {Route, Routes} from "react-router-dom";
import {Repositories} from "../../components/Repositories";
import {Main as MainPage} from "./../../components/Main"
import {Profile} from "../Profile";
import {Auth} from "../../components/HOC/Auth";
import s from "./style.module.css";

const navItems = [
    {to: "/", text: "Main"},
    {to: "/repos", text: "Repositories", authRequired: true},
    {to: "/profile", text: "Profile", authRequired: true}
];

export const Main = () => {
    return <div className={s.wrapper}>
        <Header image={logo}><span className={s.orange}>Git</span>Forge</Header>
        <Nav items={navItems}/>
        <main className={s.main}>
            <Routes>
                <Route path="/" element={<MainPage/>}/>
                <Route path="/repos" element={<Auth><Repositories/></Auth>}/>
                <Route path="/profile" element={<Auth><Profile/></Auth>}/>
                <Route path="/*" element={<div>404</div>}/>
            </Routes>
        </main>
        <Footer/>
    </div>
}
